import React, {Component} from 'react';
import Aux from '../Aux/Aux';

import classes from './Layout.module.css';

import backgroundImage from '../../assets/images/background.jpeg';

//import NavigationBar fr '../../components/Navigation/NavigationBar/NavigationBar';
//import SideDrawer from '../../components/Navigation/SideDrawer/SideDrawer';om

class Layout extends Component {

    render(){
        return(
            <Aux>
              <img className = {classes.BackgroundImage} src = {backgroundImage} alt="background"/>
                <main className={classes.Content}>
                    {this.props.children}
                </main>
            </Aux>
        );
    }

};

export default Layout;
